import React from "react";
import { Link } from "react-router-dom";

const Home = () => (
  <div className="flex flex-col items-center justify-center min-h-[60vh] px-4 py-10 text-center">
    <h1 className="text-white text-4xl font-black leading-tight tracking-[-0.033em] mb-6">YOU CAN BECOME A STAR</h1>
    <p className="text-white text-base font-normal leading-normal mb-2">Are you a songwriter?</p>
    <p className="text-white text-base font-normal leading-normal mb-2">If you are you love music as do many people around the world.</p>
    <p className="text-white text-base font-normal leading-normal mb-2">Starbuilder Music has been created to give extensive support and encouragement to songwriters.</p>
    <p className="text-white text-base font-normal leading-normal mb-2">Songwriters upload songs and music lovers vote on them, a high average mark indicating the potential for unpublished songs. Many of those in the top ten each month will be invited to perform at events we organise.</p>
    <p className="text-white text-base font-normal leading-normal mb-2">There is no charge to upload your songs. Music lover voters and will be rewarded with significant discount vouchers for events, products and services and other benefits.</p>
    <p className="text-white text-base font-normal leading-normal mb-2">Songwriters will also be able to post videos of themselves or others performing their songs and there is potential for publishing their songs in a compilation with other great songs from fellow songwriters.</p>
    <Link to="/about" className="mt-6 inline-block px-6 py-2 bg-[#dce8f3] text-[#141a1f] text-lg font-bold rounded-full hover:bg-[#bcd0e0] transition">Read on</Link>
  </div>
);

export default Home;
